import './DialogsCurrent.css';
import dialogs_profile from './../../../../images/dialogs_profile.svg'

const DialogsCurrent = (props) => {
	return (
		<div className="dialogs__current">
			<article className="item_message">
				<div className="item_message__image">
					<img src={dialogs_profile} alt="dialogs_profile"/>
				</div>
				<div className="item_message__body">
					<div className="item_message__name">Vlad</div>
					<div className="item_message__content">
						Lorem ipsum dolor sit amet, consectetur adipisicing elit. Autem, quia?
					</div>
				</div>
			</article>
		</div>
	)
}

export default DialogsCurrent;
